import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import {
  IconLookup,
  IconDefinition,
  findIconDefinition
} from '@fortawesome/fontawesome-svg-core'

library.add(fas)

const homeLookup: IconLookup = { prefix: 'fas', iconName: 'house-user' }
const homeIconDefinition: IconDefinition = findIconDefinition(homeLookup)

const hashLookup: IconLookup = { prefix: 'fas', iconName: 'hashtag' }
const hashIconDefinition: IconDefinition = findIconDefinition(hashLookup)

const bellLookup: IconLookup = { prefix: 'fas', iconName: 'bell' }
const bellIconDefinition: IconDefinition = findIconDefinition(bellLookup)

const envelopeLookup: IconLookup = { prefix: 'fas', iconName: 'envelope' }
const envelopeIconDefinition: IconDefinition = findIconDefinition(envelopeLookup)

const bookmarkLookup: IconLookup = { prefix: 'fas', iconName: 'bookmark' }
const bookmarkIconDefinition: IconDefinition = findIconDefinition(bookmarkLookup)

const userLookup: IconLookup = { prefix: 'fas', iconName: 'user' }
const userIconDefinition: IconDefinition = findIconDefinition(userLookup)

const twitterLookup: IconLookup = { prefix: 'fas', iconName: 'twitter' }
const twitterIconDefinition: IconDefinitions = findIconDefinition(twitterLookup);

type ElementData = {
  icon: IconDefinition,
  label: string
}

const IconDefinitions: ElementData[] = [
  {icon: homeIconDefinition, label: "Home"},
  {icon: hashIconDefinition, label: "Explore"},
  {icon: bellIconDefinition, label: "Notifications"},
  {icon: envelopeIconDefinition, label: "Messages"},
  {icon: bookmarkIconDefinition, label: "Bookmarks"},
  {icon: userIconDefinition, label: "Profile"}
];

export default IconDefinitions;
